import { createBrowserRouter as Router, Route, Routes, BrowserRouter, RouterProvider } from 'react-router-dom';
import Encuesta from "./compontentes/integradora";
import { Breadcrumb } from 'react-bootstrap';
import Integradora from './compontentes/integradora';
import React from 'react';

  const route = createBrowserRouter([
    {
      path:"/",
      element:<Integradora/>
    },
    {
      path:"/chart",
      element: <div>Hola desde la grafica</div>
    }
  ])

  const root = ReactDOM.createROot(document.getElementById('root'));
  root.render(
    <React.StrictMode>
      <RouterProvider router={route}/>
    </React.StrictMode>
  )
